package com.yishan.algorithm;import java.util.ArrayList;import java.util.List;public class FindDu {    public List<Integer> findDu(int[] nums) {        List<Integer> res = new ArrayList<>();        for (int i = 0; i < nums.length; i++) {            int index = nums[i];            if (nums[i] < 0) index = 0 - nums[i];            if (nums[index - 1] < 0) res.add(Math.abs(nums[i]));            else nums[index - 1] = 0 - nums[index - 1];        }        return res;    }    public static void main(String[] args) {        FindDu find = new FindDu();        int[] numm = {4, 3, 2, 7, 8, 2, 3, 1};        System.out.println(find.findDu(numm));    }}